import styled from "styled-components";
import { Link } from "react-router-dom";

const BlueButton = styled(Link)`
    background-color: blue;
    color: black;
    border:0;
    border-radius: 5px;
    padding: 12px 10px;
    text-decoration: none;
    link-text: white;
    `;


export default BlueButton;
